    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    constructor(address _PPCTokenAddress) {
        owner = msg.sender;
        PPCToken = IERC20(_PPCTokenAddress);
    }


    // PPCToken 토큰 잔액 조회
    function getTokenBalance() external view returns (uint256) {
        return PPCToken.balanceOf(address(this));
    }

    // 컨트랙트에 쌓여있는 이더리움 잔액 조회
    function getETHBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function getMyLiquidityShare() external view returns (uint) {
        return liquidityShare[msg.sender];
    }

    function initETH() external payable {
        require(msg.value <= msg.sender.balance, "not enough balance to add liquidity");
        require(msg.value > 0, "ETH amount must be greater than zero");
        // liquidityShare[msg.sender] += msg.value;
        // totalLiquidity += msg.value;
    }


    // ETH, PPC 유동성 공급 함수
    function addLiquidity() external payable {
             
        require(msg.value > 0, "ETH amount must be greater than zero");
        require(msg.value <= msg.sender.balance, "not enough balance to add liquidity");
        uint tokenAmount = PPCToken.balanceOf(address(this)) / (address(this).balance-msg.value) * msg.value; // PPC/ETH 환율 * ETH 개수, address(this).balance에는 payable로 인해 이미 msg.value가 더 해져있는 상태이므로 - msg.value를 해줘야 한다.
        require(tokenAmount <= PPCToken.balanceOf(msg.sender), "not enough balance to add liquidity");
        require(tokenAmount > 0, "PPC amount must be greater than zero");
        require(PPCToken.allowance(msg.sender,address(this)) >= tokenAmount, "ERC20: Transfer amount exceeds allowance");// Ensure the contract has enough allowance to move tokens on behalf of the sender.
        PPCToken.transferFrom(msg.sender, address(this), tokenAmount);
        liquidityShare[msg.sender] += msg.value * 10**18 / address(this).balance; // 입금한 ETH가 전체 ETH의 어느정도 비율인지 계산 후 해당 비율을 더 해준다, 지분율이 0이하의 소수점이므로 10 ** 18의 큰 값을 곱해주어야 한다. 
        emit AddLiquidity(msg.sender, msg.value, tokenAmount);
        
    }

    function removeLiquidity(uint256 ethAmount) external {
        require(ethAmount > 0, "Amount must be greater than zero");
        uint removeShare = ethAmount * 10**18 / address(this).balance; // 차감할 지분율, 지분율이 0이하의 소수점이므로 10 ** 18의 큰 값을 곱해주어야 한다. 
        require(liquidityShare[msg.sender] >= removeShare, "Not enough liquidity share"); //해당 ETH를 출금할만큼 지분이 없을 경우우
        payable(msg.sender).transfer(ethAmount); // 해당 ETH 출금
        uint tokenAmount = PPCToken.balanceOf(address(this)) / (address(this).balance + ethAmount) * ethAmount; // 출금한 ETH 비율만큼의 PPC 토큰
        require(tokenAmount > 0, "Amount must be greater than zero");
        PPCToken.transfer(msg.sender, tokenAmount); // PPC토큰 출금
        liquidityShare[msg.sender] -=  removeShare; // 출금한 ETH / 전체 ETH (지분율)삭감
        emit RemoveLiquidity(msg.sender, ethAmount, tokenAmount);
    }

