    function swap(uint256 _x, string memory _tokenSymbol) public payable {
            uint tokenReserve = PPCToken.balanceOf(address(this));
            uint ethReserve = address(this).balance;
            uint k = tokenReserve * ethReserve;
        if(keccak256(abi.encodePacked(_tokenSymbol)) == keccak256(abi.encodePacked("ETH"))) {
